-- ----------------------------
-- Table structure for sys_resource
-- ----------------------------
DROP TABLE IF EXISTS `sys_resource`;
CREATE TABLE `sys_resource` (
  `id` bigint NOT NULL,
  `url` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '后端请求路径',
  `url_tag` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'url路径标识, 用于鉴权, 用于外放给jwt',
  `path` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'web端路由路径',
  `title` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '资源名称',
  `icon` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '图标路劲 未点击',
  `icon_click` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '图片路径点击后',
  `is_button` bit(1) DEFAULT NULL COMMENT '是否是按钮菜单(如果是按钮需要上传icon_click图片)',
  `is_super` bit(1) DEFAULT b'0' COMMENT '是否是超管资源',
  `is_implementer` bit(1) DEFAULT NULL COMMENT '实施人员 1 是 0  不是',
  `sort` bigint DEFAULT NULL COMMENT '排序',
  `pid` bigint DEFAULT NULL,
  `pids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '冗余字段, web端用于编辑回显数据',
  `level` tinyint DEFAULT NULL,
  `type` tinyint DEFAULT NULL COMMENT '资源类型 0 web 1 app 2刷卡',
  `web_type` tinyint DEFAULT NULL COMMENT 'web端资源业务类型 1 工位机资源(4级菜单)',
  `layout` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'web端使用模板的类型',
  `keep_alive` bit(1) DEFAULT NULL COMMENT '强制刷新 0是有缓存 1 是不缓存',
  `create_id` bigint DEFAULT NULL,
  `tenement_id` bigint DEFAULT NULL COMMENT '租户id',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `is_del` bit(1) DEFAULT NULL COMMENT '是否删除 0 未删除 1 已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- ----------------------------
-- Records of sys_resource
-- ----------------------------


-- ----------------------------
-- Table structure for sys_role
-- ----------------------------
DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role` (
  `id` bigint NOT NULL,
  `role_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `role_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '角色编码',
  `is_super_type` bit(1) DEFAULT b'0',
  `is_enable` bit(1) DEFAULT NULL COMMENT '是否启用',
  `type` tinyint DEFAULT NULL,
  `create_id` bigint DEFAULT NULL,
  `tenement_id` bigint DEFAULT NULL COMMENT '租户id',
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `is_del` bit(1) DEFAULT NULL,
  `version` int DEFAULT NULL COMMENT '版本',
  `create_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建者名称',
  `update_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '更新者名称',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_id` bigint DEFAULT NULL COMMENT '更新者id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- ----------------------------
-- Records of sys_role
-- ----------------------------



