-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` bigint NOT NULL,
  `username` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `password` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `is_enable` bit(1) DEFAULT NULL COMMENT '是否启用',
  `level` tinyint DEFAULT NULL COMMENT '级别',
  `pid` bigint DEFAULT NULL COMMENT '用户的fu id',
  `type` tinyint DEFAULT NULL COMMENT '用户类型 0 超管 1管理员 2 实施 3 员工',
  `tenement_id` bigint DEFAULT NULL,
  `create_id` bigint DEFAULT NULL,
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `is_del` bit(1) DEFAULT NULL,
  `version` int DEFAULT NULL COMMENT '版本',
  `create_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建者名称',
  `update_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '更新者名称',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_id` bigint DEFAULT NULL COMMENT '更新者id',
  `worker_id` bigint DEFAULT NULL COMMENT '用户信息id',
  `active_status` tinyint(1) DEFAULT '0' COMMENT '账号激活状态, 0未激活(无法登陆)  ,1已激活(可以登陆)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

